CREATE TABLE m_story_main_cell(
  id INTEGER NOT NULL,
  chapter_id INTEGER NOT NULL,
  display_order INTEGER NOT NULL,
  number INTEGER,
  type INTEGER NOT NULL,
  index_text TEXT NOT NULL,
  title TEXT NOT NULL,
  summary TEXT NOT NULL,
  member_group INTEGER NOT NULL,
  thumbnail_asset_path TEXT,
  popup_thumbnail_asset_path TEXT,
  scenario_script_asset_path TEXT,
  movie_asset_path TEXT,
  live_difficulty_id INTEGER,
  unlock_live_id TEXT,
  live_icon_asset_path TEXT,
  transformation_reference_cell_id INTEGER,
  PRIMARY KEY (id),
  UNIQUE (chapter_id, display_order)
);
